import React from 'react';
import './Partners.css';
import Divider from '../image/SwirlDivider.png';

function Partners() {
    return (
        <div >
            <div class="partcard">

            </div>
            <div class="partcard1">

            </div>
            <div class="partcard2">

            </div>
            <img src={Divider} alt="Caption Divider" style={{ width: '150px', height: '25px', marginTop:'20px', marginLeft: '800px', backgroundColor:'transparent' }} />

        </div>
    )
}

export default Partners
